// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Right from './pages/Right';

function App() {
  return(
    <section className="hero mt-4">
        <div className="py-12">            
            <h1 className="text-4xl font-semibold">
                Everything<br/> 
                is better<br/> 
                with&nbsp;
                <span className="text-brown-600">
                    coffee
                </span>
            </h1>
            <p className="my-6 text-primary text-sm">
                Coffee for everyday!
            </p>
            <div className="flex gap-4 text-sm">
                <button className="flex items-center gap-2 bg-primary 
                rounded text-white px-4 py-2">
                    ORDER NOW
                    <Right />
                </button>
                <button className="flex gap-2 py-2 text-brown-600
                 font-semibold">
                    Learn more
                    <Right/>
                </button>
            </div>
        </div>
        <div className="relative">
            <Image src={'/coffee.jpg'} layout={'fill'} 
            objectFit={'contain'} alt={'coffee'}></Image>
        </div>
    </section>
);
}

export default App;
